	add("deacon", "{\"term\":\"deacon\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"ancient greek (to 1453)\"], \"text\":\"From Old english (ca. 450-1100) \u0027diacon\u0027 from \u0027diaconus\u0027 from Ancient greek (to 1453) \u0027διᾱ́κονος\u0027 (servant, minister)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A designated minister of charity in the early Church (see Acts 6:1-6\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A clergyman ranked directly below a priest, with duties of helping the priests and carrying out parish work\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Free Churches\u0027: A lay leader of a congregation who assists the pastor\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Anglicanism\u0027: An ordained clergyman usually serving a year prior to being ordained presbyter, though in some cases they remain a permanent deacon\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Methodism\u0027: A separate office from that of minister, neither leading to the other; instead there is a permanent deaconate\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A junior lodge officer\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The lowest office in the , generally held by 12 or 13 year old boys or recent converts\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A male calf of a dairy breed, so called because they are usually\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"deaconed (see below\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The chairman of an incorporated company\", \"priority\":10}]}, \"synonyms\":{}}");

