	add("deadfall", "{\"term\":\"deadfall\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A kind of trap for large animals, consisting of a heavy board or log that falls on to the prey\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"deadwoo\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A cheap, rough saloon or bar\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Thomas Pynchon, \u0027Against the Day\u0027, Vintage 2007, p. 406\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"They had lived down in horse barns, army “A” tents with the old blood-stains onto them, city hotels with canopy beds, woke up in back rooms of \u0027\u0027deadfalls\u0027\u0027 where the bars had toothmarks end to end\", \"priority\":5}]}, \"synonyms\":{}}");

	add("deadhead", "{\"term\":\"deadhead\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|dead|head|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person either admitted to a theatrical or musical performance without charge, or paid to atten\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1901\u0027\u0027 R. J. Broadbent, [http://www.gutenberg.org/etext/13469 A History of Pantomime\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Among the Romans.... The free admission tickets were small ivory death\u0027s heads, and specimens of these are to be seen in the Museum of Naples. From this custom, it is stated, that we derive our word \u0027\u0027\u0026quot;Deadhead,\u0026quot;\u0027\u0027 as denoting one who has a free entrance to places of amusement\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An employee of a transportation company, especially a pilot, traveling as a passenger for logistical reasons, for example to return home or travel to their next assignment\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2002,\u0027\u0027 w:Steven Steven Spielberg, \u0027w:Catch Me if You Catch Me If You Can\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Are you my \u0027\u0027deadhead\u0027\u0027 to Miami\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Anyone traveling for free\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1873\u0027\u0027, Mark Twain (Samuel Clemens) and Charles Dudley Warner, \u0027[http://www.gutenberg.org/etext/5821 The Gilded Age, Part 4\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"With the check came two through tickets—good on the railroad from Hawkeye to Washington via New York—and they were \u0027\u0027\u0026quot;deadhead\u0026quot;\u0027\u0027 tickets, too, which had been given to Senator Dilworthy by the railway companies. Senators and representatives were paid thousands of dollars by the government for traveling expenses, but they always traveled \u0027\u0027\u0026quot;deadhead\u0026quot;\u0027\u0027 both ways, and then did as any honorable, high-minded men would naturally do—declined to receive the mileage tendered them by the government. The Senator had plenty of railway passes, and could. easily spare two to Laura—one for herself and one for a male escort\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1882\u0027\u0027, Bret Harte, \u0027[http://www.gutenberg.org/etext/2794 Found At Blazing Star\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"I reckon I won\u0027t take the vote of any \u0027\u0027deadhead\u0027\u0027 passenger\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1904\u0027\u0027, Gideon Wurdz, \u0027[http://www.gutenberg.org/etext/1989 The Foolish Dictionary\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"PASSENGER One who does not travel on a pass. (Antonym for \u0027\u0027Deadhead\u0027\u0027). From Eng. pass, to go, and Grk. endidomi, to give up. One who has to give up to go\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1908\u0027\u0027, Wallace Irwin, \u0027[http://www.gutenberg.org/etext/5332 The Love Sonnets of a Car Conductor\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The yap that kicks and rings a \u0027\u0027deadhead\u0027\u0027 cal\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Must either spend or else get off the car\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A train or truck moved between cities with no passengers or freight, in order to make it available for servic\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A person staying at a lodging, such as a hotel or boarding house, without paying rent; freeloader\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"1872\u0027\u0027, Oliver Wendell Holmes, Sr, \u0027[http://www.gutenberg.org/etext/2666 The Poet At The Breakfast Table\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"For the Caput mortuum (or \u0027\u0027deadhead\u0027\u0027, in vulgar phrase) is apt to be furnished with a Venter vivus, or, as we may say, a lively appetite\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"1922\u0027\u0027, Rex Beach, \u0027[http://www.gutenberg.org/etext/6425 Flowing Gold\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"Haviland had a sense of humor; it would make a story too good to keep--the new oil operator, the magnificent and mysterious New York financier, a \u0027\u0027\u0026quot;deadhead\u0026quot;\u0027\u0027 at the Ajax. Oh, murder\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"A stupid or boring person; dullar\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"1967,\u0027\u0027 w:James Jones James Jones, \u0027Go to the Widow-Maker\u0027, Delacorte Press (1967), 72\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"quot;Listen, you two \u0027\u0027deadheads\u0027\u0027,\u0026quot; he growled at them, more viciously energetic than he meant, and both turned to stare. He softened his tone. \u0026quot;What\u0027s going on here, anyway? What kind of a morgue is this? Is this any way to spend my last four days in town? Come on, let\u0027s all go out and do something.\u0026quot\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"Driftwood\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"A fan of the rock band the w:Grateful Grateful Dead (usually Deadhead\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"A zombie\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Mark Tufo, Sylwia Serwinska, \u0027Zombie Fallout\u0027 (page 148\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"I was dreaming about working at Wal-Mart before the \u0027\u0027deadheads\u0027\u0027 came\", \"priority\":30}]}, \"synonyms\":{}}");

